import React from "react";
import { MyContext } from "../context";
import { NavMain } from "../styledComponents/StyledComps";


export default function NavBar(){
	return(
		<MyContext.Consumer>
		{context => (
			<NavMain>
				<h1>MoMe</h1>
				<span class="mdi user-circle-outline"></span>


			</NavMain>
		)}
		</MyContext.Consumer>
	)
}
